INSERT INTO `t_word` VALUES (1,'CONFER','CONFER','verb','<div><!--block--><strong>Meaning:-</strong></div><ul><li><!--block--><strong>to exchange ideas on a particular subject, often in order to reach a decision on what action to take</strong></li></ul><div><!--block--><strong>Example:-</strong></div><ul><li><!--block--><em>I need some time to confer&nbsp;</em><strong><em>with</em></strong><em>&nbsp;my lawyer.</em></li></ul><div><!--block--><br><br></div><div><!--block--><strong>Thesaurus: synonyms and related words</strong></div><div><!--block--><strong>Debate &amp; discussion</strong></div><ul><li><!--block-->broach</li><li><!--block-->catch</li><li><!--block-->catch up</li><li><!--block-->closure</li><li><!--block-->cloture</li><li><!--block-->compare</li><li><!--block-->compare notes&nbsp;<em>idiom</em></li><li><!--block-->conciliation</li><li><!--block-->contentious</li><li><!--block-->contentiousness</li><li><!--block-->debate</li><li><!--block-->devil\'s advocate</li><li><!--block-->free collective bargaining</li><li><!--block-->moot</li><li><!--block-->sit</li><li><!--block-->tendentiously</li><li><!--block-->tendentiousness</li><li><!--block-->thematize</li><li><!--block-->toss sth around</li><li><!--block-->trialogue</li></ul>','2019-01-08 23:53:54','2020-08-21 22:04:18','2020-08-21 22:04:18');
INSERT INTO `t_word` VALUES (2,'DIELECTRIC','DIELECTRIC','adjective','<div><!--block-->having the property of transmitting electric force without conduction; insulating.</div>','2019-01-08 23:53:54','2020-08-21 20:30:13','2020-08-21 20:30:13');
INSERT INTO `t_word` VALUES (3,'WREAKED','WREAKED','verb','<div><!--block--><strong>Meaning:-</strong></div><ul><li><!--block--><strong>to cause something to happen in a violent and often uncontrolled way:</strong></li></ul><div><!--block--><strong>Example:-</strong></div><ul><li><!--block--><em>The recent storms have wreaked&nbsp;</em><strong><em>havoc</em></strong><em>&nbsp;on crops.</em></li><li><!--block--><em>She was determined to wreak&nbsp;</em><strong><em>revenge/vengeance</em></strong><em>&nbsp;on both him and his family.</em></li></ul><div><!--block--><strong>Synonyms</strong></div><ul><li><!--block-->bring</li><li><!--block-->cause</li><li><!--block-->inflict</li><li><!--block-->visit sth on/upon&nbsp;<em>sb&nbsp;</em><strong><em>old use or formal</em></strong></li></ul><div><!--block--><strong>Thesaurus: synonyms and related words</strong></div><div><!--block--><strong>Causing things to happen</strong></div><ul><li><!--block-->activation</li><li><!--block-->actuation</li><li><!--block-->agent</li><li><!--block-->associate</li><li><!--block-->awaken (sth) in sb</li><li><!--block-->be associated with sth</li><li><!--block-->contribute</li><li><!--block-->draw</li><li><!--block-->equal</li><li><!--block-->fuel</li><li><!--block-->give rise to&nbsp;<em>idiom</em></li><li><!--block-->implement</li><li><!--block-->implementation</li><li><!--block-->in</li><li><!--block-->inaugurate</li><li><!--block-->realize</li><li><!--block-->result in sth</li><li><!--block-->self-induced</li><li><!--block-->send</li><li><!--block-->stir sth up</li></ul>','2019-01-08 23:53:54','2020-08-21 22:35:35','2020-08-21 22:35:35');
INSERT INTO `t_word` VALUES (4,'RINGINGLY','RINGINGLY','adjective','<div><!--block-->in a ringing manner</div>','2019-01-08 23:53:54','2020-08-21 20:23:23','2020-09-06 12:27:20');
INSERT INTO `t_word` VALUES (5,'RESIST','RESIST','verb','<div><!--block--><strong>Meaning-</strong></div><ol><li><!--block-->withstand the action or effect of</li><li><!--block-->try to prevent by action or argument</li><li><!--block-->refrain from (something tempting)</li><li><!--block-->struggle against</li></ol><div><!--block--><br><strong>Example</strong></div><ol><li><!--block-->a resistant substance applied as a coating to protect a surface during a process, for example to prevent dye or glaze adhering</li></ol><div><!--block--><strong>Derivatives</strong></div><ol><li><!--block-->resister -&gt; noun</li><li><!--block-->resistibility -&gt; noun</li><li><!--block-->resistible -&gt; adjective</li></ol><div><!--block--><strong>Origin ME :</strong>&nbsp;from OFr. resister or L. resistere, from re-(expressing opposition) + sistere\'stop\'</div>','2019-01-08 23:53:54','2020-08-21 21:08:57','2020-08-21 21:08:57');
INSERT INTO `t_word` VALUES (6,'DECLARING','DECLARING',NULL,'<div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1a:&nbsp;</strong>to make known formally, officially, or explicitlypublicly&nbsp;<em>declared</em>&nbsp;her opposition to the plan</div><div><!--block--><strong>b:&nbsp;</strong>to make known as a determinationThe judge&nbsp;<em>declared</em>&nbsp;the defendant fit to stand trial.She was&nbsp;<em>declared</em>&nbsp;the rightful heir to the throne.</div><div><!--block--><strong>2</strong><em>obsolete&nbsp;</em><strong>:&nbsp;</strong>to make clear</div><div><!--block--><strong>3:&nbsp;</strong>to make evident&nbsp;<strong>:&nbsp;</strong>SHOWa glimpse of his head in outline …&nbsp;<em>declared</em>&nbsp;his present state of mind— Osbert Sitwell</div><div><!--block--><strong>4:&nbsp;</strong>to state emphatically&nbsp;<strong>:&nbsp;</strong>AFFIRM<em>declares</em>&nbsp;his innocence\"You are quite a quiz, I do&nbsp;<em>declare</em>!\"— Charles Dickens</div><div><!--block--><strong>5:&nbsp;</strong>to make a full statement of (one\'s taxable or dutiable property)Large purchases must be&nbsp;<em>declared</em>&nbsp;at customs.</div><div><!--block--><strong><br>6</strong><em>in card games</em></div><div><!--block--><strong>a:&nbsp;</strong>to make a bid or announcement naming (a trump suit or no-trump)</div><div><!--block--><strong>b:&nbsp;</strong>MELD</div><div><!--block--><strong>7:&nbsp;</strong>to make payable<em>declare</em>&nbsp;a dividend<br><br></div><div><!--block--><em>intransitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>to make a declarationpoetry … evokes rather than merely&nbsp;<em>declares</em>— C. S. Kilby</div><div><!--block--><strong>2:&nbsp;</strong>to avow one\'s opinion or support<em>declaring</em>&nbsp;for or against a candidate</div><div><!--block--><strong>3:&nbsp;</strong>to announce one\'s intentions (as to run for political office)<em>declared</em>&nbsp;for mayor</div><div><!--block--><strong>Other Words from&nbsp;</strong><strong><em>declare<br></em></strong><br></div><div><!--block--><strong>Synonyms<br></strong><br></div><div><!--block--><strong>Choose the Right Synonym<br></strong><br></div><div><!--block--><strong>More Example Sentences<br></strong><br></div><div><!--block--><strong>Learn More about&nbsp;</strong><strong><em>declare<br></em></strong><br></div><div><!--block--><br></div><div><!--block--><strong>Other Words from&nbsp;</strong><strong><em>declare&nbsp;</em></strong><strong>declarable</strong>&nbsp;\\ di-??kler-??-?b?l&nbsp; \\&nbsp;<em>adjective<br></em><br></div><div><!--block--><strong>Synonyms for&nbsp;</strong><strong><em>declare</em></strong><strong>Synonyms</strong></div><ul><li><!--block-->advertise,&nbsp;</li><li><!--block-->announce,&nbsp;</li><li><!--block-->annunciate,&nbsp;</li><li><!--block-->blare,&nbsp;</li><li><!--block-->blaze,&nbsp;</li><li><!--block-->blazon,&nbsp;</li><li><!--block-->broadcast,&nbsp;</li><li><!--block-->enunciate,&nbsp;</li><li><!--block-->flash,&nbsp;</li><li><!--block-->give out,&nbsp;</li><li><!--block-->herald,&nbsp;</li><li><!--block-->placard,&nbsp;</li><li><!--block-->post,&nbsp;</li><li><!--block-->proclaim,&nbsp;</li><li><!--block-->promulgate,&nbsp;</li><li><!--block-->publicize,&nbsp;</li><li><!--block-->publish,&nbsp;</li><li><!--block-->release,&nbsp;</li><li><!--block-->sound,&nbsp;</li><li><!--block-->trumpet</li></ul><div><!--block--><strong>Visit the Thesaurus for More&nbsp;</strong></div><div><!--block--><strong>Choose the Right Synonym for&nbsp;</strong><strong><em>declare<br></em></strong>DECLARE, ANNOUNCE, PROCLAIM, PROMULGATE mean to make known publicly. DECLARE implies explicitness and usually formality in making known.&nbsp; the referee&nbsp;<em>declared</em>&nbsp;the contest a draw&nbsp; ANNOUNCE implies the declaration of something for the first time.&nbsp;<em>announced</em>&nbsp;their engagement at a party PROCLAIM implies declaring clearly, forcefully, and authoritatively.&nbsp; the president&nbsp;<em>proclaimed</em>&nbsp;a national day of mourning&nbsp; PROMULGATE implies the proclaiming of a dogma, doctrine, or law.&nbsp;<em>promulgated</em>&nbsp;an edict of religious toleration<strong>synonyms</strong>&nbsp;see in addition assert</div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>declare</em></strong><strong>&nbsp;in a Sentence</strong>&nbsp;<br>The government has just&nbsp;<em>declared</em>&nbsp;a state of emergency. He openly&nbsp;<em>declared</em>&nbsp;his love for her.<strong>See MoreRecent Examples on the Web</strong>The prosecutors asked Johnson to&nbsp;<em>declare&nbsp;</em>the state law — which says they must be paid the same as attorneys who defend indigent clients — unconstitutional.— Lauren Mcgaughy,&nbsp;<em>Dallas News</em>, \"Criminal cases against Texas AG Ken Paxton will move back to Collin County, judge decides,\" 25 June 2020The shifting strategies are an acknowledgment that even the most successful countries cannot&nbsp;<em>declare&nbsp;</em>victory until a vaccine is found.— Benjamin Mueller,&nbsp;<em>BostonGlobe.com</em>, \"How the world is learning to live with a deadly pandemic,\" 24 June 2020These example sentences are selected automatically from various online news sources to reflect current usage of the word \'declare.\' Views expressed in the examples do not represent the opinion of Merriam-Webster or its editors. Send us feedback.<strong>See More</strong></div><div><!--block--><strong>First Known Use of&nbsp;</strong><strong><em>declare<br></em></strong>14th century, in the meaning defined at transitive sense 1a</div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>declare<br></em></strong>Middle English, from Anglo-French &amp; Latin; Anglo-French&nbsp;<em>declarer</em>, from Latin&nbsp;<em>declarare</em>, from&nbsp;<em>de-</em>&nbsp;+&nbsp;<em>clarare</em>&nbsp;to make visible, from&nbsp;<em>clarus</em>&nbsp;clear — more at CLEAR</div>','2019-01-08 23:53:54','2020-07-12 18:14:25','2020-08-22 07:50:48');
INSERT INTO `t_word` VALUES (7,'PERMEABLE','PERMEABLE','noun','<div><!--block--><strong>Pronounciation :-</strong>&nbsp;pre·?am·?ble | \\ ?pr?-?am-b?l&nbsp; , pr?-?am- \\<br><br><strong>Definition of&nbsp;</strong><strong><em>preamble</em></strong></div><div><!--block--><strong>1:&nbsp;</strong>an introductory statement<em>especially</em>&nbsp;<strong>:&nbsp;</strong>the introductory part of a constitution or statute that usually states the reasons for and intent of the law</div><div><!--block--><strong>2:&nbsp;</strong>an introductory fact or circumstance<em>especially</em>&nbsp;<strong>:&nbsp;</strong>one indicating what is to follow</div><div><!--block--><br><br><strong>Synonyms for&nbsp;</strong><strong><em>preamble</em></strong></div><div><!--block--><strong>Synonyms<br></strong><br></div><ul><li><!--block-->curtain-raiser,&nbsp;</li><li><!--block-->overture,&nbsp;</li><li><!--block-->preliminary,&nbsp;</li><li><!--block-->prelude,&nbsp;</li><li><!--block-->prologue</li><li><!--block-->&nbsp;(<em>also</em>&nbsp;prolog),&nbsp;</li><li><!--block-->warm-up</li></ul><div><!--block--><br><br><strong>Recent Examples on the Web</strong></div><div><!--block-->If that prediction comes true, then what befell the Northeast could look like mere&nbsp;<em>preamble</em>.</div><div><!--block-->— Robinson Meyer,&nbsp;<em>The Atlantic</em>, \"The Week America Lost Control of the Pandemic,\" 3 July 2020</div><div><!--block--><br></div><div><!--block-->So the&nbsp;<em>preamble&nbsp;</em>to our exhibit on CIA\'s role in Operation Enduring Freedom, of course, starts with the attacks on our country on 9/11.</div><div><!--block-->—&nbsp;<em>CBS News</em>, \"Former CIA museum curator highlights the agency\'s most important artifacts - transcript,\" 17 June 2020<br><br><strong>Legal Definition of&nbsp;</strong><strong><em>preamble</em></strong></div><div><!--block--><strong>:&nbsp;</strong>an introductory statement (as to a contract)<em>especially</em>&nbsp;<strong>:&nbsp;</strong>the introductory part of a constitution or statute that usually states the reasons for and intent of the lawNOTE: While preambles do not state law and therefore are not judicially enforceable, they are used to determine legislative intent when interpreting statutes.</div><div><!--block--><br><br><strong>First Known Use of&nbsp;</strong><strong><em>preamble<br></em></strong>14th century, in the meaning defined at sense 1<br><br></div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>preamble<br></em></strong>Middle English, from Middle French&nbsp;<em>preambule</em>, from Medieval Latin&nbsp;<em>preambulum</em>, from Late Latin, neuter of&nbsp;<em>praeambulus</em>&nbsp;walking in front of, from Latin&nbsp;<em>prae-</em>&nbsp;+&nbsp;<em>ambulare</em>&nbsp;to walk</div><div><!--block--><br><br><br></div>','2019-01-08 23:53:54','2020-07-12 18:14:40','2020-08-21 17:22:32');
INSERT INTO `t_word` VALUES (8,'ASPIRATED','ASPIRATED','noun','<div><!--block-->Type :-Noun&nbsp;<br><strong>Pronunciation :-&nbsp;</strong>as·?pi·?rate | \\ ?a-sp(?-)r?t&nbsp; \\<br><br><strong>Definition of&nbsp;</strong><strong><em>aspirate</em></strong><strong>&nbsp;(Entry 1 of 2)</strong></div><div><!--block--><strong>1:&nbsp;</strong>an independent sound \\h\\ or a character (such as the letter&nbsp;<em>h</em>) representing it</div><div><!--block--><strong>2:&nbsp;</strong>a consonant having aspiration as its final componentin English the \\p\\ of&nbsp;<em>pit</em>&nbsp;is an&nbsp;<em>aspirate</em></div><div><!--block--><strong>3:&nbsp;</strong>material removed by aspiration</div><div><!--block--><br>Type :- Verb<br>as·?pi·?rate | \\ ?a-sp?-?r?t&nbsp; \\</div><div><!--block--><strong>aspirated</strong>;&nbsp;<strong>aspirating</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>aspirate</em></strong><strong>&nbsp;(Entry 2 of 2)</strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>to pronounce (a vowel or a consonant) with aspiration (see ASPIRATION sense 3a)</div><div><!--block--><strong>2a:&nbsp;</strong>to draw by suction</div><div><!--block--><strong>b:&nbsp;</strong>to remove (something such as blood) by aspiration</div><div><!--block--><strong>c:&nbsp;</strong>to take into the lungs by aspiration</div><div><!--block--><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>aspirate</em></strong><strong>&nbsp;in a Sentence<br>Noun</strong>&nbsp;The word “hour” is not pronounced with an&nbsp;<em>aspirate</em>.<br><strong>Verb</strong>&nbsp;The letter “h” in “house” is&nbsp;<em>aspirated</em>, but the “h” in “hour” is not.<br><br><br><strong>Recent Examples on the Web: Noun</strong></div><div><!--block-->According to veterinary oncologists, a fine needle&nbsp;<em>aspirate&nbsp;</em>to see what kinds of cells it’s made of is almost always in order in these cases.</div><div><!--block-->— Dr. Patty Khuly,&nbsp;<em>miamiherald</em>, \"Most lumps are nothing serious, but don\'t take a chance. Call the vet.,\" 5 July 2018</div><div><!--block--><strong>Recent Examples on the Web: Verb</strong></div><div><!--block-->The original car was based on the V12 Vantage, but this one is based on the more powerful V12 S, with a version of Aston’s sonorous naturally&nbsp;<em>aspirated&nbsp;</em>5.9-liter V-12 engine, retuned to deliver 591 horsepower.</div><div><!--block-->— Mike Duff,&nbsp;<em>Car and Driver</em>, \"Aston Martin Vantage Zagato V12 Coupe, Speedster Pair Revealed,\" 21 Apr. 2020<br><br><strong>First Known Use of&nbsp;</strong><strong><em>aspirate<br></em></strong><strong>Noun<br></strong>1617, in the meaning defined at sense 1<br><strong>Verb<br></strong>circa 1700, in the meaning defined at sense 1<br><br></div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>aspirate<br></em></strong><strong>Verb&nbsp;</strong>Latin&nbsp;<em>aspiratus</em>, past participle of&nbsp;<em>aspirare</em></div><div><!--block--><br><br><strong>&nbsp;</strong></div>','2019-01-08 23:53:54','2020-08-21 20:30:34','2020-08-21 20:30:34');
INSERT INTO `t_word` VALUES (9,'REPTILIAN','REPTILIAN','adjective','<div><!--block-->Type :- Adjective<br><strong>Pronunciation :-</strong>&nbsp;rep·?til·?ian | \\ rep-?ti-l?-?n&nbsp; , -?til-y?n \\<br><br><strong>Definition of&nbsp;</strong><strong><em>reptilian</em></strong><strong>&nbsp;(Entry 1 of 2)</strong></div><div><!--block--><strong>1:&nbsp;</strong>resembling or having the characteristics of the reptiles</div><div><!--block--><strong>2:&nbsp;</strong>of or relating to the reptiles</div><div><!--block--><strong>3:&nbsp;</strong>cold-bloodedly treacherousa&nbsp;<em>reptilian</em>&nbsp;villain— Theodore Dreiser</div><div><!--block--><br></div><div><!--block--><strong>reptilian</strong>&nbsp;<strong>noun</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>reptilian</em></strong><strong>&nbsp;(Entry 2 of 2)</strong></div><div><!--block--><strong>:&nbsp;</strong>REPTILE sense 2</div><div><!--block--><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>reptilian</em></strong><strong>&nbsp;in a Sentence</strong></div><div><!--block--><strong>Recent Examples on the Web: Adjective<br></strong>Here are even more reasons why the&nbsp;<em>reptilian&nbsp;</em>rocker is McCartney.<br>— Rachel Yang,&nbsp;<em>EW.com</em>, \"The Masked Singer final 3 predictions: Who\'s under Turtle, Frog, and Night Angel masks, and who will win,\" 15 May 2020<br><br>Although the first giant turtle specimens were identified in 1976 from remains discovered in Venezuela, knowledge of these&nbsp;<em>reptilian&nbsp;</em>giants had stalled due to a lack of full specimens – until now.<br>— Doyle Rice,&nbsp;<em>USA TODAY</em>, \"Fossils of giant, car-sized turtles discovered in South America,\" 15 Feb. 2020</div><div><!--block--><br><br><strong>First Known Use of&nbsp;</strong><strong><em>reptilian</em></strong></div><div><!--block--><strong>Adjective</strong></div><div><!--block-->1833, in the meaning defined at sense 1<br><br></div><div><!--block--><strong>Noun</strong></div><div><!--block-->1838, in the meaning defined above<br><br><strong>Synonyms &amp; Antonyms of&nbsp;</strong><strong><em>reptilian</em></strong></div><div><!--block-->as in&nbsp;<em>disgusting</em>,&nbsp;<em>repulsive<br></em><strong>Synonyms &amp; Near Synonyms for&nbsp;</strong><strong><em>reptilian</em></strong></div><ul><li><!--block-->disgusting,&nbsp;</li><li><!--block-->repugnant,&nbsp;</li><li><!--block-->repulsive,&nbsp;</li><li><!--block-->revolting,&nbsp;</li><li><!--block-->revulsive</li><li><!--block-->abhorrent,&nbsp;</li><li><!--block-->abominable,&nbsp;</li><li><!--block-->condemnable,&nbsp;</li><li><!--block-->detestable,&nbsp;</li><li><!--block-->execrable,&nbsp;</li><li><!--block-->hateful,&nbsp;</li><li><!--block-->loathsome,&nbsp;</li><li><!--block-->odious</li><li><!--block-->discreditable,&nbsp;</li><li><!--block-->disgraceful,&nbsp;</li><li><!--block-->dishonorable,&nbsp;</li><li><!--block-->disreputable,&nbsp;</li><li><!--block-->ignominious,&nbsp;</li><li><!--block-->shameful</li><li><!--block-->cheap,&nbsp;</li><li><!--block-->contemptible,&nbsp;</li><li><!--block-->cruddy,&nbsp;</li><li><!--block-->deplorable,&nbsp;</li><li><!--block-->despicable,&nbsp;</li><li><!--block-->dirty,&nbsp;</li><li><!--block-->grubby,&nbsp;</li><li><!--block-->lame,&nbsp;</li><li><!--block-->lousy,&nbsp;</li><li><!--block-->mean,&nbsp;</li><li><!--block-->nasty,&nbsp;</li><li><!--block-->paltry,&nbsp;</li><li><!--block-->pitiable,&nbsp;</li><li><!--block-->pitiful,&nbsp;</li><li><!--block-->ratty,&nbsp;</li><li><!--block-->scabby,&nbsp;</li><li><!--block-->scummy,&nbsp;</li><li><!--block-->scurvy,&nbsp;</li><li><!--block-->sneaking,&nbsp;</li><li><!--block-->sorry,&nbsp;</li><li><!--block-->wretched</li><li><!--block-->base,&nbsp;</li><li><!--block-->ignoble,&nbsp;</li><li><!--block-->low,&nbsp;</li><li><!--block-->shabby,&nbsp;</li><li><!--block-->sordid,&nbsp;</li><li><!--block-->squalid,&nbsp;</li><li><!--block-->vile</li><li><!--block-->blamable,&nbsp;</li><li><!--block-->censurable,&nbsp;</li><li><!--block-->reprehensible,&nbsp;</li><li><!--block-->reproachable</li><li><!--block-->cowardly,&nbsp;</li><li><!--block-->craven,&nbsp;</li><li><!--block-->dastardly</li><li><!--block-->unethical,&nbsp;</li><li><!--block-->unprincipled,&nbsp;</li><li><!--block-->unscrupulous</li></ul><div><!--block--><br></div><div><!--block--><strong>Antonyms &amp; Near Antonyms for&nbsp;</strong><strong><em>reptilian<br></em></strong><br></div><ul><li><!--block-->admirable,&nbsp;</li><li><!--block-->commendable,&nbsp;</li><li><!--block-->creditable,&nbsp;</li><li><!--block-->laudable,&nbsp;</li><li><!--block-->meritorious,&nbsp;</li><li><!--block-->praiseworthy</li><li><!--block-->high-minded,&nbsp;</li><li><!--block-->honest,&nbsp;</li><li><!--block-->honorable,&nbsp;</li><li><!--block-->noble,&nbsp;</li><li><!--block-->principled,&nbsp;</li><li><!--block-->redoubtable,&nbsp;</li><li><!--block-->reputable,&nbsp;</li><li><!--block-->right-minded,&nbsp;</li><li><!--block-->scrupulous,&nbsp;</li><li><!--block-->upright</li><li><!--block-->ethical,&nbsp;</li><li><!--block-->good,&nbsp;</li><li><!--block-->moral,&nbsp;</li><li><!--block-->right,&nbsp;</li><li><!--block-->righteous,&nbsp;</li><li><!--block-->virtuous</li></ul><div><!--block--><br><br></div>','2019-01-08 23:53:54','2020-07-12 18:15:03','2020-07-12 18:15:03');
INSERT INTO `t_word` VALUES (10,'BASEMENTS','BASEMENTS','noun','<div><!--block--><strong>Pronunciation :-</strong>&nbsp;base·?ment | \\ ?b?s-m?nt&nbsp; \\<br><br><strong>Definition of&nbsp;</strong><strong><em>basement</em></strong></div><ul><li><!--block--><strong>1:&nbsp;</strong>the part of a building that is wholly or partly below ground level</li><li><!--block--><strong>2:&nbsp;</strong>the ground floor facade or interior in Renaissance architecture</li><li><!--block--><strong>3:&nbsp;</strong>the lowest or fundamental part of something<em>specifically</em>&nbsp;<strong>:&nbsp;</strong>the rocks underlying stratified rocks</li><li><!--block--><strong>4&nbsp;</strong><em>chiefly New England&nbsp;</em><strong>:&nbsp;</strong>a toilet or washroom especially in a school</li><li><!--block--><strong>5</strong><ul><li><!--block--><strong>a:&nbsp;</strong>a low state, rank, or conditionWith their stock in the&nbsp;<em>basement</em>&nbsp;and red ink all over their balance sheet, many struggling [companies] are finding that fund-raising has become an exceedingly difficult proposition.— Brad Stone</li><li><!--block--><strong>b:&nbsp;</strong>the lowest place in the standings&nbsp;<strong>:&nbsp;</strong>CELLAR sense 2Last year, the Phillies finished in the&nbsp;<em>basement</em>&nbsp;of the NL East with 68 wins, tied with the Cubs for the fewest wins in the league.—&nbsp;<em>Boston Herald</em></li></ul></li></ul><div><!--block--><br><strong>Other Words from&nbsp;</strong><strong><em>basement<br></em></strong><strong>basementless</strong>&nbsp;\\ ?b?s-?m?nt-?l?s&nbsp; \\&nbsp;<em>adjective<br></em><br></div><div><!--block--><strong>Synonyms for&nbsp;</strong><strong><em>basement</em></strong><strong>Synonyms</strong></div><ul><li><!--block-->cellar</li></ul><div><!--block--><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>basement</em></strong><strong>&nbsp;in a Sentence</strong>&nbsp;<br>we store our bicycles in the&nbsp;<em>basement</em>&nbsp;during the winter the&nbsp;<em>basement</em>&nbsp;of the outdoor fountain needs a lot of restoration work<br><br><strong>Recent Examples on the Web<br></strong>Cleveland Water is on the scene and making repairs, and also walking door to door to identify residents affected by&nbsp;<em>basement&nbsp;</em>flooding issues.—&nbsp;<em>cleveland</em>, \"Portions of South Euclid, Lyndhurst under boil water alert until 4 a.m. July 6,\" 5 July 2020<br><br>Learning to be an NFL QB in your&nbsp;<em>basement&nbsp;</em>is like building a rocket ship in art class.—<br>&nbsp;Paul Daugherty,&nbsp;<em>The Enquirer</em>, \"Doc\'s TML: It\'s impossible to tell me how cutting two games from the NFL preseason sucks,\" 3 July 2020<br><br><br><strong>First Known Use of&nbsp;</strong><strong><em>basement<br></em></strong>1730, in the meaning defined at sense 1<br><br></div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>basement<br></em></strong>BASE entry 1 or BASE entry 2 + -MENT, probably after Italian&nbsp;<em>basamento<br><br><br></em><strong>Synonyms &amp; Antonyms of&nbsp;</strong><strong><em>basements</em></strong></div><div><!--block--><strong>1</strong>a room or set of rooms below the surface of the ground</div><ul><li><!--block-->we store our bicycles in the&nbsp;<em>basement</em>&nbsp;during the winter</li></ul><div><!--block--><br></div><div><!--block--><strong>Synonyms for&nbsp;</strong><strong><em>basements<br></em></strong><br></div><ul><li><!--block-->cellars</li></ul><div><!--block--><br></div><div><!--block--><strong>Words Related to&nbsp;</strong><strong><em>basements<br></em></strong><br></div><ul><li><!--block-->cellarages</li><li><!--block-->bunkers,&nbsp;</li><li><!--block-->crawlways,&nbsp;</li><li><!--block-->foundations,&nbsp;</li><li><!--block-->holds,&nbsp;</li><li><!--block-->vaults</li><li><!--block-->cyclone cellars,&nbsp;</li><li><!--block-->storm cellars</li></ul><div><!--block--><strong>2</strong>the lowest part, place, or point</div><ul><li><!--block-->the&nbsp;<em>basement</em>&nbsp;of the outdoor fountain needs a lot of restoration work</li></ul><div><!--block--><br></div><div><!--block--><strong>Synonyms for&nbsp;</strong><strong><em>basements<br></em></strong><br></div><ul><li><!--block-->bases,&nbsp;</li><li><!--block-->bottoms,&nbsp;</li><li><!--block-->feet</li><li><!--block-->&nbsp;(<em>also</em>&nbsp;foot),&nbsp;</li><li><!--block-->nadirs,&nbsp;</li><li><!--block-->rock bottoms</li></ul><div><!--block--><br></div><div><!--block--><strong>Words Related to&nbsp;</strong><strong><em>basements<br></em></strong><br></div><ul><li><!--block-->bases,&nbsp;</li><li><!--block-->bedrocks,&nbsp;</li><li><!--block-->beds,&nbsp;</li><li><!--block-->foundations,&nbsp;</li><li><!--block-->grounds,&nbsp;</li><li><!--block-->groundworks,&nbsp;</li><li><!--block-->keystones,&nbsp;</li><li><!--block-->seats,&nbsp;</li><li><!--block-->underpinnings</li></ul><div><!--block--><br></div><div><!--block--><strong>Near Antonyms for&nbsp;</strong><strong><em>basements<br></em></strong><br></div><ul><li><!--block-->acmes,&nbsp;</li><li><!--block-->apexes</li><li><!--block-->&nbsp;(<em>or</em>&nbsp;apices),&nbsp;</li><li><!--block-->climaxes,&nbsp;</li><li><!--block-->crests,&nbsp;</li><li><!--block-->culminations,&nbsp;</li><li><!--block-->heights,&nbsp;</li><li><!--block-->meridians,&nbsp;</li><li><!--block-->peaks,&nbsp;</li><li><!--block-->pinnacles,&nbsp;</li><li><!--block-->summits,&nbsp;</li><li><!--block-->tips,&nbsp;</li><li><!--block-->tip-tops,&nbsp;</li><li><!--block-->zeniths</li></ul><div><!--block--><br></div><div><!--block--><strong>Antonyms for&nbsp;</strong><strong><em>basements<br></em></strong><br></div><ul><li><!--block-->heads,&nbsp;</li><li><!--block-->tops,&nbsp;</li><li><!--block-->vertices</li><li><!--block-->&nbsp;(<em>also</em>&nbsp;vertexes)</li></ul><div><!--block--><br><br></div>','2019-01-08 23:53:55','2020-07-12 18:15:30','2020-08-21 09:35:04');
