INSERT INTO `t_word` VALUES (12,'DESPERADO','DESPERADO','noun','<div><!--block--><strong>Pronunciation :-</strong>&nbsp;des·?per·?a·?do | \\ ?de-sp?-?rä-(?)d?&nbsp; , -?r?- \\</div><div><!--block--><em>plural&nbsp;</em><strong>desperadoes</strong><em>&nbsp;or&nbsp;</em><strong>desperados<br></strong><br></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>desperado</em></strong></div><div><!--block--><strong>:&nbsp;</strong>a bold or violent criminal<br><em>especially</em>&nbsp;<strong>:&nbsp;</strong>a bandit of the western U.S. in the 19th century</div><div><!--block--><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>desperado</em></strong><strong>&nbsp;in a Sentence</strong>&nbsp;<br>the notorious&nbsp;<em>desperados</em>&nbsp;of the Wild West<br><br><strong>Recent Examples on the Web<br></strong>Quarterback Jimmy Garoppolo No one faced more pressure to thrive, aside from those&nbsp;<em>desperados&nbsp;</em>on the roster bubble.<br>— Cam Inman,&nbsp;<em>The Mercury News</em>, \"49ers vs. Chiefs: 3 studs, 3 duds,\" 25 Aug. 2019<br><br>There\'s going to be 15&nbsp;<em>desperados&nbsp;</em>over those two nights.<br>—&nbsp;<em>NBC News</em>, \"Meet the Press - July 28, 2019,\" 28 July 2019<br><br><strong>First Known Use of&nbsp;</strong><strong><em>desperado<br></em></strong>1647, in the meaning defined above<br><br></div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>desperado<br></em></strong>probably alteration of obsolete&nbsp;<em>desperate</em>&nbsp;desperado, from&nbsp;<em>desperate</em>, adjective<br><br><strong>Synonyms &amp; Antonyms of&nbsp;</strong><strong><em>desperado</em></strong></div><div><!--block--><em>old-fashioned&nbsp;</em>a violent criminal who is not afraid of getting hurt or caught</div><ul><li><!--block-->A documentary about some notorious&nbsp;<em>desperados</em>&nbsp;of the Wild West.</li></ul><div><!--block--><br></div><div><!--block--><strong>Synonyms &amp; Near Synonyms for&nbsp;</strong><strong><em>desperado<br></em></strong><br></div><ul><li><!--block-->bandit,&nbsp;</li><li><!--block-->bravo,&nbsp;</li><li><!--block-->outlaw</li><li><!--block-->baddie</li><li><!--block-->&nbsp;(<em>or</em>&nbsp;baddy),&nbsp;</li><li><!--block-->beast,&nbsp;</li><li><!--block-->brute,&nbsp;</li><li><!--block-->caitiff,&nbsp;</li><li><!--block-->devil,&nbsp;</li><li><!--block-->evildoer,&nbsp;</li><li><!--block-->fiend,&nbsp;</li><li><!--block-->heavy,&nbsp;</li><li><!--block-->hound,&nbsp;</li><li><!--block-->knave,&nbsp;</li><li><!--block-->meanie</li><li><!--block-->&nbsp;(<em>also</em>&nbsp;meany),&nbsp;</li><li><!--block-->miscreant,&nbsp;</li><li><!--block-->monster,&nbsp;</li><li><!--block-->nazi,&nbsp;</li><li><!--block-->no-good,&nbsp;</li><li><!--block-->rapscallion,&nbsp;</li><li><!--block-->rascal,&nbsp;</li><li><!--block-->reprobate,&nbsp;</li><li><!--block-->rogue,&nbsp;</li><li><!--block-->savage,&nbsp;</li><li><!--block-->scalawag</li><li><!--block-->&nbsp;(<em>or</em>&nbsp;scallywag),&nbsp;</li><li><!--block-->scamp,&nbsp;</li><li><!--block-->scapegrace,&nbsp;</li><li><!--block-->scoundrel,&nbsp;</li><li><!--block-->varlet,&nbsp;</li><li><!--block-->villain,&nbsp;</li><li><!--block-->wretch</li><li><!--block-->villainess</li><li><!--block-->crook,&nbsp;</li><li><!--block-->culprit,&nbsp;</li><li><!--block-->felon,&nbsp;</li><li><!--block-->lawbreaker,&nbsp;</li><li><!--block-->malefactor,&nbsp;</li><li><!--block-->offender,&nbsp;</li><li><!--block-->perp,&nbsp;</li><li><!--block-->perpetrator,&nbsp;</li><li><!--block-->transgressor</li><li><!--block-->sinner,&nbsp;</li><li><!--block-->trespasser,&nbsp;</li><li><!--block-->wrongdoer</li><li><!--block-->cad,&nbsp;</li><li><!--block-->heel,&nbsp;</li><li><!--block-->serpent,&nbsp;</li><li><!--block-->snake,&nbsp;</li><li><!--block-->viper</li><li><!--block-->con,&nbsp;</li><li><!--block-->convict,&nbsp;</li><li><!--block-->jailbird</li><li><!--block-->assassin,&nbsp;</li><li><!--block-->cutthroat,&nbsp;</li><li><!--block-->gangster,&nbsp;</li><li><!--block-->goon,&nbsp;</li><li><!--block-->gunman,&nbsp;</li><li><!--block-->hoodlum,&nbsp;</li><li><!--block-->hooligan,&nbsp;</li><li><!--block-->racketeer,&nbsp;</li><li><!--block-->ruffian,&nbsp;</li><li><!--block-->thug</li><li><!--block-->rough,&nbsp;</li><li><!--block-->rowdy,&nbsp;</li><li><!--block-->tough</li><li><!--block-->loser,&nbsp;</li><li><!--block-->lowlife,&nbsp;</li><li><!--block-->ne\'er-do-well,&nbsp;</li><li><!--block-->stinker,&nbsp;</li><li><!--block-->trash</li></ul><div><!--block--><br></div><div><!--block--><strong>Antonyms &amp; Near Antonyms for&nbsp;</strong><strong><em>desperado<br></em></strong><br></div><ul><li><!--block-->angel,&nbsp;</li><li><!--block-->innocent,&nbsp;</li><li><!--block-->saint</li><li><!--block-->hero</li></ul>','2019-01-08 23:53:55','2020-08-21 20:24:18','2020-08-21 20:24:18');
INSERT INTO `t_word` VALUES (13,'ASPIRATES','ASPIRATES','noun','<div><!--block--><strong>aspirate</strong>&nbsp;noun<br><strong>Pronunciation :-</strong>&nbsp;as·?pi·?rate | \\ ?a-sp(?-)r?t&nbsp; \\</div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>aspirate</em></strong><strong>&nbsp;(Entry 1 of 2)</strong></div><div><!--block--><strong>1:&nbsp;</strong>an independent sound \\h\\ or a character (such as the letter&nbsp;<em>h</em>) representing it</div><div><!--block--><strong>2:&nbsp;</strong>a consonant having aspiration as its final componentin English the \\p\\ of&nbsp;<em>pit</em>&nbsp;is an&nbsp;<em>aspirate</em></div><div><!--block--><strong>3:&nbsp;</strong>material removed by aspiration</div><div><!--block--><br></div><div><!--block--><strong>aspirate</strong>&nbsp;<strong>verb</strong></div><div><!--block-->as·?pi·?rate | \\ ?a-sp?-?r?t&nbsp; \\</div><div><!--block--><strong>aspirated</strong>;&nbsp;<strong>aspirating</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>aspirate</em></strong><strong>&nbsp;(Entry 2 of 2)</strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>to pronounce (a vowel or a consonant) with aspiration (see ASPIRATION sense 3a)</div><div><!--block--><strong>2a:&nbsp;</strong>to draw by suction</div><div><!--block--><strong>b:&nbsp;</strong>to remove (something such as blood) by aspiration</div><div><!--block--><strong>c:&nbsp;</strong>to take into the lungs by aspiration</div><div><!--block--><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>aspirate</em></strong><strong>&nbsp;in a Sentence<br>Noun</strong>&nbsp;The word “hour” is not pronounced with an&nbsp;<em>aspirate</em>.<br><strong>Verb</strong>&nbsp;The letter “h” in “house” is&nbsp;<em>aspirated</em>, but the “h” in “hour” is not.<strong><br><br>Recent Examples on the Web: Noun</strong></div><div><!--block-->According to veterinary oncologists, a fine needle&nbsp;<em>aspirate&nbsp;</em>to see what kinds of cells it’s made of is almost always in order in these cases.</div><div><!--block-->— Dr. Patty Khuly,&nbsp;<em>miamiherald</em>, \"Most lumps are nothing serious, but don\'t take a chance. Call the vet.,\" 5 July 2018</div><div><!--block--><strong>Recent Examples on the Web: Verb</strong></div><div><!--block-->The original car was based on the V12 Vantage, but this one is based on the more powerful V12 S, with a version of Aston’s sonorous naturally&nbsp;<em>aspirated&nbsp;</em>5.9-liter V-12 engine, retuned to deliver 591 horsepower.</div><div><!--block-->— Mike Duff,&nbsp;<em>Car and Driver</em>, \"Aston Martin Vantage Zagato V12 Coupe, Speedster Pair Revealed,\" 21 Apr. 2020</div><div><!--block--><br><br><strong>First Known Use of&nbsp;</strong><strong><em>aspirate<br></em></strong><strong>Noun<br></strong>1617, in the meaning defined at sense 1<br><strong>Verb<br></strong>circa 1700, in the meaning defined at sense 1<br><br></div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>aspirate<br></em></strong><strong>Verb<br></strong>Latin&nbsp;<em>aspiratus</em>, past participle of&nbsp;<em>aspirare</em></div><div><!--block--><br><strong><br></strong><br></div>','2019-01-08 23:53:55','2020-07-12 18:16:00','2020-08-21 21:12:05');
INSERT INTO `t_word` VALUES (14,'EXHUME','EXHUME','verb','<div><!--block-->ex·?hume | \\ ig-?züm&nbsp; , igz-?yüm, iks-?(h)yüm \\</div><div><!--block--><strong>exhumed</strong>;&nbsp;<strong>exhuming</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>exhume</em></strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>DISINTER<em>exhume</em>&nbsp;a body</div><div><!--block--><strong>2:&nbsp;</strong>to bring back from neglect or obscurity<em>exhumed</em>&nbsp;a great deal of information from the archives<br><br><strong>Other Words from&nbsp;</strong><strong><em>exhume<br></em></strong><strong>exhumation</strong>&nbsp;\\ ?eks-?(h)yü-??m?-?sh?n&nbsp; , ?eg-?zü-? , ?egz-?yü-? \\&nbsp;<em>noun<br></em><strong>exhumer</strong>&nbsp;\\ ig-??zü-?m?r&nbsp; , igz-??yü-? , iks-??(h)yü-? \\&nbsp;<em>noun<br></em><br></div><div><!--block--><strong>Synonyms &amp; Antonyms for&nbsp;</strong><strong><em>exhume</em></strong><strong>Synonyms</strong></div><ul><li><!--block-->disinter,&nbsp;</li><li><!--block-->unearth</li></ul><div><!--block--><strong>Antonyms</strong></div><ul><li><!--block-->bury,&nbsp;</li><li><!--block-->entomb,&nbsp;</li><li><!--block-->inhume,&nbsp;</li><li><!--block-->inter,&nbsp;</li><li><!--block-->tomb</li></ul><div><!--block--><br><strong>Examples of&nbsp;</strong><strong><em>exhume</em></strong><strong>&nbsp;in a Sentence</strong></div><div><!--block-->&nbsp;the remains of John Paul Jones were&nbsp;<em>exhumed</em>&nbsp;in Paris and transported with great ceremony to the U.S. Naval Academy</div><div><!--block--><br><strong>Recent Examples on the Web</strong></div><div><!--block-->So the jackhammered section of floor was left open and a permit to&nbsp;<em>exhume&nbsp;</em>a handful of graves for study was obtained from the Virginia Department of Historic Resources.</div><div><!--block-->—&nbsp;<em>Washington Post</em>, \"Mysteries, skeletons abound under Virginia church’s floor,\" 28 June 2020</div><div><!--block--><br></div><div><!--block-->The commission also ratified a 5-0 vote in April by the board’s executive committee authorizing a permit for the Texas General Land Office to&nbsp;<em>exhume&nbsp;</em>partly intact sets of skeletal remains unearthed in recent months in the mission-era Alamo church.</div><div><!--block-->— Scott Huddleston,&nbsp;<em>ExpressNews.com</em>, \"State commission recognizes Alamo church in downtown San Antonio as a cemetery,\" 17 June 2020</div><div><!--block--><br><strong>First Known Use of&nbsp;</strong><strong><em>exhume<br></em></strong>15th century, in the meaning defined at sense 1</div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>exhume<br></em></strong>Middle English, from Medieval Latin&nbsp;<em>exhumare</em>, from Latin&nbsp;<em>ex</em>&nbsp;out of +&nbsp;<em>humus</em>&nbsp;earth — more at EX-, HUMBLE<br><br><strong>Synonyms &amp; Antonyms of&nbsp;</strong><strong><em>exhume</em></strong></div><div><!--block-->to remove from place of burial</div><ul><li><!--block-->the remains of John Paul Jones were&nbsp;<em>exhumed</em>&nbsp;in Paris and transported with great ceremony to the U.S. Naval Academy</li></ul><div><!--block--><br></div><div><!--block--><strong>Synonyms for&nbsp;</strong><strong><em>exhume</em></strong></div><ul><li><!--block-->disinter,&nbsp;</li><li><!--block-->unearth</li></ul><div><!--block--><br></div><div><!--block--><strong>Antonyms for&nbsp;</strong><strong><em>exhume</em></strong></div><ul><li><!--block-->bury,&nbsp;</li><li><!--block-->entomb,&nbsp;</li><li><!--block-->inhume,&nbsp;</li><li><!--block-->inter,&nbsp;</li><li><!--block-->tomb</li></ul><div><!--block--><br><br><br><br></div>','2019-01-08 23:53:55','2020-07-12 18:23:56','2020-07-12 18:23:56');
INSERT INTO `t_word` VALUES (15,'SEDGE','SEDGE','noun','<div><!--block--><strong>a plant like grass that grows on wet ground, often next to rivers:</strong></div><div><!--block--><em>This wetland sedge forms low-growing attractive clumps of fine-leaved vegetation.</em></div><div><!--block--><br><br><strong>Definition of&nbsp;</strong><strong><em>sedge</em></strong></div><div><!--block--><strong>:&nbsp;</strong>any of a family (Cyperaceae, the sedge family) of usually tufted monocotyledonous marsh plants differing from the related grasses in having achenes and solid stems<em>especially</em>&nbsp;<strong>:&nbsp;</strong>any of a cosmopolitan genus (<em>Carex</em>)<br><br><strong>Other Words from&nbsp;</strong><strong><em>sedge</em></strong></div><div><!--block--><strong>sedgy</strong>&nbsp;\\ ?se-?j?&nbsp; \\&nbsp;<em>adjective<br><br></em><strong>Examples of&nbsp;</strong><strong><em>sedge</em></strong><strong>&nbsp;in a Sentence</strong></div><div><!--block--><strong>Recent Examples on the Web<br></strong>That’s led to a rival movement in recent years, where people replant their yards with overgrown shrubs and billowing&nbsp;<em>sedges&nbsp;</em>to foster real, thriving ecosystems.<br>— Grace Wade,&nbsp;<em>Popular Science</em>, \"America’s obsession with lawns has 160-year-old roots,\" 1 June 2020<br><br>Using satellite data, drones, and on-the-ground fieldwork, a team of dozens of scientists—ecologists, biologists, geographers, climate scientists, and more—is finding that vegetation like shrubs, grasses, and&nbsp;<em>sedges&nbsp;</em>are growing more abundant.<br>— Matt Simon,&nbsp;<em>Wired</em>, \"The Arctic Is Getting Greener. That\'s Bad News for All of Us,\" 18 Feb. 2020<br><br><strong>First Known Use of&nbsp;</strong><strong><em>sedge<br></em></strong>before the 12th century, in the meaning defined above<br><br></div><div><!--block--><strong>History and Etymology for&nbsp;</strong><strong><em>sedge<br></em></strong>Middle English&nbsp;<em>segge</em>, from Old English&nbsp;<em>secg</em>; akin to Middle High German&nbsp;<em>segge</em>&nbsp;sedge, Old English&nbsp;<em>sagu</em>&nbsp;saw — more at SAW</div><div><!--block--><br><br></div>','2019-01-08 23:53:55','2020-07-14 20:46:14','2020-07-14 20:46:14');
INSERT INTO `t_word` VALUES (16,'MISQUOTE','MISQUOTE','noun','<div><!--block--><strong>misquote</strong>&nbsp;<strong>noun<br></strong>mis·?quote | \\ ?mis-?kw?t &nbsp;<em>also&nbsp;</em>-?k?t \\</div><div><!--block--><em>plural&nbsp;</em><strong>misquotes</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>misquote</em></strong><strong>&nbsp;(Entry 1 of 2)</strong></div><div><!--block--><strong>:&nbsp;</strong>an act or instance of quoting something incorrectly&nbsp;<strong>:&nbsp;</strong>MISQUOTATION<br>\"If it doesn\'t show up in the drug controls, then it\'s not doping,\" [Michele] Ferrari was quoted as having said (a statement he has since characterized as a&nbsp;<em>misquote</em>) …<br>— Bill Gifford<br>They will defend his every&nbsp;<em>misquote</em>&nbsp;and misuse of scripture as the shortcomings of a new believer or even the second coming of Cyrus.— Erick Erickson</div><div><!--block--><br></div><div><!--block--><strong>misquote</strong>&nbsp;<strong>verb</strong></div><div><!--block-->mis·?quote | \\ ?mis-?kw?t &nbsp;<em>also&nbsp;</em>-?k?t \\</div><div><!--block--><strong>misquoted</strong>;&nbsp;<strong>misquoting</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>misquote</em></strong><strong>&nbsp;(Entry 2 of 2)</strong></div><div><!--block--><em><br>transitive + intransitive</em></div><div><!--block--><strong>:&nbsp;</strong>to quote (someone or something) incorrectly<br>… when it quickly became clear that these were not the facts, he took refuge in the trapped politician\'s standard excuse: The press had&nbsp;<em>misquoted</em>&nbsp;him.<br>— Geoffrey C. Ward<br>He&nbsp;<em>misquotes</em>&nbsp;frequently, providing others with opportunity to give him a taste of his own medicine.— Susan Rusinko</div><div><!--block--><br></div><div><!--block--><strong>First Known Use of&nbsp;</strong><strong><em>misquote<br></em></strong><strong>Noun<br></strong>1855, in the meaning defined above<br><strong>Verb<br></strong>1644, in the meaning defined above</div><div><!--block--><br></div>','2019-01-08 23:53:55','2020-07-14 20:51:07','2020-07-14 20:51:07');
INSERT INTO `t_word` VALUES (17,'TAXONOMY','TAXONOMY','noun','<div><!--block-->a system for naming and organizing things, especially plants and animals, into groups that share similar qualities</div>','2019-01-08 23:53:55','2020-06-14 21:40:54','2020-06-14 21:40:54');
INSERT INTO `t_word` VALUES (18,'MANIFESTED','MANIFESTED','verb','<div><!--block--><strong>to show something clearly, through signs or actions:</strong></div><ul><li><!--block--><em>The workers chose to manifest their dissatisfaction&nbsp;</em><strong><em>in</em></strong><em>&nbsp;a series of strikes.</em></li><li><!--block--><em>The illness first manifested&nbsp;</em><strong><em>itself</em></strong><em>&nbsp;</em><strong><em>in/as</em></strong><em>&nbsp;severe stomach pains.</em></li><li><!--block--><em>Lack of confidence in the company manifested&nbsp;</em><strong><em>itself</em></strong><em>&nbsp;</em><strong><em>in</em></strong><em>&nbsp;a fall in the share price.</em></li></ul><div><!--block--><strong>Synonyms</strong></div><ul><li><!--block-->demonstrate (SHOW)</li><li><!--block-->reveal</li><li><!--block-->show (MAKE SEEN)</li></ul>','2019-01-08 23:53:55','2020-06-14 21:49:14','2020-06-14 21:49:14');
