INSERT INTO `t_word` VALUES (20,'SLUGGING','SLUGGING','noun','<div><!--block--><strong>slug</strong>&nbsp;<strong>noun (1)</strong></div><div><!--block-->Save Word</div><div><!--block-->To save this word, you\'ll need to log in.&nbsp;<strong>Log In</strong></div><div><!--block-->\\ ?sl?g&nbsp; \\</div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>slug</em></strong><strong>&nbsp;(Entry 1 of 4)</strong></div><div><!--block--><strong>1:&nbsp;</strong>SLUGGARD</div><div><!--block--><strong>2:&nbsp;</strong>a lump, disk, or cylinder of material (such as plastic or metal): such as</div><div><!--block--><strong>a(1):&nbsp;</strong>a musket ball</div><div><!--block--><strong>(2):&nbsp;</strong>BULLET</div><div><!--block--><strong>b:&nbsp;</strong>a piece of metal roughly shaped for subsequent processing</div><div><!--block--><strong>c:&nbsp;</strong>a $50 gold piece</div><div><!--block--><strong>d:&nbsp;</strong>a disk for insertion in a slot machine<em>especially</em>&nbsp;<strong>:&nbsp;</strong>one used illegally instead of a coin</div><div><!--block--><strong>3:&nbsp;</strong>any of numerous chiefly terrestrial pulmonate gastropods (order Stylommatophora) that are found in most parts of the world where there is a reasonable supply of moisture and are closely related to the land snails but are long and wormlike and have only a rudimentary shell often buried in the mantle or entirely absent</div><div><!--block--><strong>4:&nbsp;</strong>a smooth soft larva of a sawfly or moth that creeps like a mollusk</div><div><!--block--><strong>5a:&nbsp;</strong>a quantity of liquor drunk in one swallow</div><div><!--block--><strong>b:&nbsp;</strong>a detached mass of fluid (such as water vapor or oil) that causes impact (as in a circulating system)</div><div><!--block--><strong>6a:&nbsp;</strong>a strip of metal thicker than a printer\'s lead</div><div><!--block--><strong>b:&nbsp;</strong>a line of type cast as one piece</div><div><!--block--><strong>c:&nbsp;</strong>a usually temporary type line serving to instruct or identify</div><div><!--block--><strong>7:&nbsp;</strong>the gravitational unit of mass in the foot-pound-second system to which a pound force can impart an acceleration of one foot per second per second and which is equal to the mass of an object weighing 32 pounds</div><div><!--block--><br></div><div><!--block--><strong>slug</strong>&nbsp;<strong>verb (1)</strong></div><div><!--block--><strong>slugged</strong>;&nbsp;<strong>slugging</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>slug</em></strong><strong>&nbsp;(Entry 2 of 4)</strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>to add a printer\'s slug to</div><div><!--block--><strong>2:&nbsp;</strong>to drink in gulps —often used with&nbsp;<em>down</em></div><div><!--block--><br></div><div><!--block--><strong>slug</strong>&nbsp;<strong>noun (2)</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>slug</em></strong><strong>&nbsp;(Entry 3 of 4)</strong></div><div><!--block--><strong>:&nbsp;</strong>a heavy blow especially with the fist</div><div><!--block--><br></div><div><!--block--><strong>slug</strong>&nbsp;<strong>verb (2)</strong></div><div><!--block--><strong>slugged</strong>;&nbsp;<strong>slugging</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>slug</em></strong><strong>&nbsp;(Entry 4 of 4)</strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>to strike heavily with or as if with the fist or a bat</div><div><!--block--><strong>2:&nbsp;</strong>FIGHT sense 4b —usually used in the phrase&nbsp;<em>slug it out</em></div><div><!--block--><strong>Illustration of&nbsp;</strong><strong><em>slug<br></em></strong><span data-trix-cursor-target=\"true\" data-trix-serialize=\"false\">?</span><figure class=\"attachment attachment-preview\" data-trix-attachment=\"{&quot;content