INSERT INTO `t_word` VALUES (21,'HYDRATE','HYDRATE',NULL,'<div><!--block--><strong>hydrate</strong>&nbsp;<strong>noun</strong></div><div><!--block-->Save Word</div><div><!--block-->To save this word, you\'ll need to log in.&nbsp;<strong>Log In</strong></div><div><!--block-->hy·?drate | \\ ?h?-?dr?t&nbsp; \\</div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>hydrate</em></strong><strong>&nbsp;(Entry 1 of 2)</strong></div><div><!--block--><strong>:&nbsp;</strong>a compound formed by the union of water with some other substance</div><div><!--block--><br></div><div><!--block--><strong>hydrate</strong>&nbsp;<strong>verb</strong></div><div><!--block--><strong>hydrated</strong>;&nbsp;<strong>hydrating</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>hydrate</em></strong><strong>&nbsp;(Entry 2 of 2)</strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>1:&nbsp;</strong>to cause to take up or combine with water or the elements of water</div><div><!--block--><strong>2:&nbsp;</strong>to supply with ample fluid or moisture<em>hydrates</em>&nbsp;and softens the skin</div><div><!--block--><em>intransitive verb</em></div><div><!--block--><strong>:&nbsp;</strong>to become a hydrate<br><br><strong>Other Words from&nbsp;</strong><strong><em>hydrate<br></em></strong><strong>Verb<br>hydration</strong>&nbsp;\\ h?-??dr?-?sh?n&nbsp; \\&nbsp;<em>noun<br></em><strong>hydrator</strong>&nbsp;\\ ?h?-??dr?-?t?r&nbsp; \\&nbsp;<em>noun<br></em><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>hydrate</em></strong><strong>&nbsp;in a Sentence<br>Verb</strong>&nbsp;<br>lotions and creams that&nbsp;<em>hydrate</em>&nbsp;the skin Drink fluids to&nbsp;<em>hydrate</em>&nbsp;the body.<br><br><strong>Recent Examples on the Web:&nbsp;<br>Noun<br></strong>Those without air conditioning can take respite in the cool building and&nbsp;<em>hydrate&nbsp;</em>at one of the many locations across the Phoenix-metro area.<br>— Helena Wegner,&nbsp;<em>The Arizona Republic</em>, \"Summer heat offers additional challenges for those experiencing homelessness in Phoenix,\" 12 July 2020<br><br>Panthenol is the hero ingredient that’s known to&nbsp;<em>hydrate&nbsp;</em>strands and prevent breakage.<br>— Nicole Saunders,&nbsp;<em>CNN Underscored</em>, \"Keep natural hair healthy and hydrated with these 25 expert-approved products,\" 9 July 2020<br><br><br><br><strong>hydrate</strong>&nbsp;<strong>verb</strong></div><div><!--block-->Save Word</div><div><!--block-->To save this word, you\'ll need to log in.&nbsp;<strong>Log In</strong></div><div><!--block--><strong>Synonyms &amp; Antonyms of&nbsp;</strong><strong><em>hydrate</em></strong></div><div><!--block-->as in&nbsp;<em>moisturize</em>,&nbsp;<em>moisten<br><br></em><strong>Synonyms &amp; Near Synonyms for&nbsp;</strong><strong><em>hydrate</em></strong></div><ul><li><!--block-->asperse,&nbsp;</li><li><!--block-->bedew,&nbsp;</li><li><!--block-->damp,&nbsp;</li><li><!--block-->dampen,&nbsp;</li><li><!--block-->drizzle,&nbsp;</li><li><!--block-->humidify,&nbsp;</li><li><!--block-->mist,&nbsp;</li><li><!--block-->moisten,&nbsp;</li><li><!--block-->moisturize,&nbsp;</li><li><!--block-->shower,&nbsp;</li><li><!--block-->sprinkle</li><li><!--block-->bathe,&nbsp;</li><li><!--block-->bedraggle,&nbsp;</li><li><!--block-->douse</li><li><!--block-->&nbsp;(<em>also</em>&nbsp;dowse),&nbsp;</li><li><!--block-->drench,&nbsp;</li><li><!--block-->drown,&nbsp;</li><li><!--block-->soak,&nbsp;</li><li><!--block-->sodden,&nbsp;</li><li><!--block-->sop,&nbsp;</li><li><!--block-->souse,&nbsp;</li><li><!--block-->wash,&nbsp;</li><li><!--block-->water,&nbsp;</li><li><!--block-->waterlog,&nbsp;</li><li><!--block-->water-soak,&nbsp;</li><li><!--block-->wet,&nbsp;</li><li><!--block-->wet down</li><li><!--block-->deluge,&nbsp;</li><li><!--block-->flood,&nbsp;</li><li><!--block-->hose (down),&nbsp;</li><li><!--block-->inundate,&nbsp;</li><li><!--block-->overflow</li><li><!--block-->submerge,&nbsp;</li><li><!--block-->swamp</li><li><!--block-->splash</li><li><!--block-->impregnate,&nbsp;</li><li><!--block-->saturate,&nbsp;</li><li><!--block-->steep</li><li><!--block-->flush,&nbsp;</li><li><!--block-->irrigate,&nbsp;</li><li><!--block-->lave,&nbsp;</li><li><!--block-->rinse,&nbsp;</li><li><!--block-->slosh,&nbsp;</li><li><!--block-->sluice</li><li><!--block-->dip,&nbsp;</li><li><!--block-->duck,&nbsp;</li><li><!--block-->dunk</li><li><!--block-->rehydrate,&nbsp;</li><li><!--block-->rewash,&nbsp;</li><li><!--block-->rewet</li></ul><div><!--block--><br></div><div><!--block--><strong>Antonyms &amp; Near Antonyms for&nbsp;</strong><strong><em>hydrate<br></em></strong><br></div><ul><li><!--block-->dehydrate,&nbsp;</li><li><!--block-->desiccate,&nbsp;</li><li><!--block-->dry,&nbsp;</li><li><!--block-->parch,&nbsp;</li><li><!--block-->scorch,&nbsp;</li><li><!--block-->sear</li><li><!--block-->dewater,&nbsp;</li><li><!--block-->evaporate,&nbsp;</li><li><!--block-->freeze-dry</li><li><!--block-->drip-dry,&nbsp;</li><li><!--block-->wring</li><li><!--block-->dehumidify</li></ul>','2019-01-08 23:53:55','2020-07-15 17:25:14','2020-07-15 17:25:14');
INSERT INTO `t_word` VALUES (22,'REARMING','REARMING','verb','<div><!--block--><strong>rearm</strong>&nbsp;<strong>verb</strong></div><div><!--block-->Save Word</div><div><!--block-->To save this word, you\'ll need to log in.&nbsp;<strong>Log In</strong></div><div><!--block-->re·?arm | \\ (?)r?-?ärm&nbsp; \\</div><div><!--block--><strong>rearmed</strong>;&nbsp;<strong>rearming</strong>;&nbsp;<strong>rearms</strong></div><div><!--block--><strong>Definition of&nbsp;</strong><strong><em>rearm</em></strong></div><div><!--block--><em><br>transitive verb</em></div><div><!--block--><strong>:&nbsp;</strong>to arm (a nation, a military force, etc.) again with new or better weapons</div><div><!--block--><em>intransitive verb</em></div><div><!--block--><strong>:&nbsp;</strong>to become armed again<br><br><strong>Other Words from&nbsp;</strong><strong><em>rearm<br></em></strong><strong>rearmament</strong>&nbsp;\\ (?)r?-??är-?m?-?m?nt&nbsp; \\&nbsp;<em>noun<br></em><br></div><div><!--block--><strong>Examples of&nbsp;</strong><strong><em>rearm</em></strong><strong>&nbsp;in a Sentence</strong>&nbsp;<br>The treaty forbids the country to&nbsp;<em>rearm</em>. Another country was&nbsp;<em>rearming</em>&nbsp;their enemies.<br><br><strong>Recent Examples on the Web</strong></div><div><!--block-->Now, three years later, key components of the deal have not been implemented and some of the rebels appear to be abandoning the reintegration process and&nbsp;<em>rearming&nbsp;</em>for renewed conflict.</div><div><!--block-->—&nbsp;<em>Fox News</em>, \"Massive Colombia anti-government protests continue amid heightened violent crackdown,\" 26 Nov. 2019</div><div><!--block--><br></div><div><!--block-->All that fuel has to come from somewhere, typically the continental U.S., and is then driven in trucks to&nbsp;<em>rearming&nbsp;</em>and refueling points just behind the front line.</div><div><!--block-->— Kyle Mizokami,&nbsp;<em>Popular Mechanics</em>, \"Future Tanks Could Be Powered by Electricity,\" 16 Sep. 2019</div><div><!--block--><br><br><strong>First Known Use of&nbsp;</strong><strong><em>rearm</em></strong></div><div><!--block-->1750, in the meaning defined at transitive sense</div><div><!--block--><br><br><strong>rearm</strong>&nbsp;<strong>verb</strong></div><div><!--block--><br></div><div><!--block--><strong>English Language Learners Definition of&nbsp;</strong><strong><em>rearm</em></strong></div><div><!--block--><strong>:&nbsp;</strong>to obtain new weapons</div><div><!--block--><strong>:&nbsp;</strong>to supply (someone or something) with new weapons</div><div><!--block--><br><br><br><br><br><br><br><br></div>','2019-01-08 23:53:56','2020-07-15 17:30:08','2020-07-15 17:30:08');
