INSERT INTO `t_word` VALUES (3328,'MONASTERY','MONASTERY','noun','<ul><li><!--block--><strong>a building in which monks live and worship</strong></li><li><!--block--><strong>a building or group of buildings in which monks (= religious men) live and worship</strong></li></ul><div><!--block--><strong>Compare</strong></div><ul><li><!--block-->convent</li><li><!--block-->nunnery&nbsp;<em>literary</em></li></ul><div><!--block--><strong>&nbsp;Thesaurus: synonyms and related words</strong></div><div><!--block--><strong>Religious people: monks &amp; nuns</strong></div><ul><li><!--block-->abbess</li><li><!--block-->abbey</li><li><!--block-->abbot</li><li><!--block-->anchorite</li><li><!--block-->ascetic</li><li><!--block-->benedictine</li><li><!--block-->flagellant</li><li><!--block-->Franciscan</li><li><!--block-->friar</li><li><!--block-->friary</li><li><!--block-->hermit</li><li><!--block-->monastic</li><li><!--block-->monasticism</li><li><!--block-->monk</li><li><!--block-->mother</li><li><!--block-->novice</li><li><!--block-->prioress</li><li><!--block-->priory</li><li><!--block-->Trappist monk</li><li><!--block-->veil</li></ul><div><!--block--><br>EXAMPLES of&nbsp;<strong>monastery</strong></div><div><!--block-->monastery</div><ul><li><!--block-->With a limited economic base, nonetheless, the investment in creating a cosmology within the&nbsp;<em>monastery</em>&nbsp;in the early 9th century is truly extraordinary.<em>From&nbsp;</em><a href=\"https://www.cambridge.org/gb/cambridgeenglish/better-learning-insights/corpus\"><em>Cambridge English Corpus</em></a></li><li><!--block-->He analyzes a number of cases of monks who deliberately left their monasteries despite the measures taken by the pope to restrain such a practice.<em>From&nbsp;</em><a href=\"https://www.cambridge.org/gb/cambridgeenglish/better-learning-insights/corpus\"><em>Cambridge English Corpus</em></a></li></ul>','2019-01-08 23:56:27','2020-06-15 12:32:09','2020-06-15 12:32:09');
